import React, { useState, useEffect } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { createCV, updateCV, fetchAllCVs, deleteCV } from "../"; // Importer nødvendige API-funksjoner
import InputField from "../components/InputField"; // Sørg for at du har en InputField-komponent

const UserCV = () => {
  const [cv, setCv] = useState({
    personalInfo: { name: "", email: "", phone: "" },
    skills: [],
    education: [],
    experience: [],
    references: [],
  });
  const [loading, setLoading] = useState(false);
  const [isEditing, setIsEditing] = useState(false);
  const { id } = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    if (id) {
      setIsEditing(true);
      fetchCV();
    }
  }, [id]);

  const fetchCV = async () => {
    setLoading(true);
    try {
      const response = await fetchAllCVs();
      const userCV = response.find((cv) => cv._id === id);
      if (userCV) {
        setCv(userCV);
      }
    } catch (error) {
      console.error("Feil ved henting av CV:", error);
    } finally {
      setLoading(false);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCv((prevCv) => ({
      ...prevCv,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      if (isEditing) {
        await updateCV(id, cv);
      } else {
        await createCV(cv);
      }
      navigate("/dashboard"); // Naviger tilbake til dashboard etter oppretting/oppdatering
    } catch (error) {
      console.error("Feil ved lagring av CV:", error);
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async () => {
    setLoading(true);
    try {
      await deleteCV(id);
      navigate("/dashboard"); // Naviger tilbake til dashboard etter sletting
    } catch (error) {
      console.error("Feil ved sletting av CV:", error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="p-8 bg-gradient-to-r from-[#90E0EF] to-[#CAF0F8] min-h-screen">
      <h1 className="mb-20 flex items-center justify-center text-3xl font-bold text-[#023E8A]">
        {isEditing ? "Rediger CV" : "Opprett CV"}
      </h1>

      {loading && <p>Lasting...</p>}

      <form
        onSubmit={handleSubmit}
        className="max-w-lg p-10 mb-8 bg-white rounded-lg shadow-lg "
      >
        <h2 className="text-center mb-4 text-xl text-[#023E8A]">
          {isEditing ? "Rediger CV" : "Opprett CV"}
        </h2>

        <InputField
          type="text"
          placeholder="Navn"
          name="personalInfo.name"
          value={cv.personalInfo.name}
          onChange={handleChange}
          required
        />

        <InputField
          type="email"
          placeholder="E-post"
          name="personalInfo.email"
          value={cv.personalInfo.email}
          onChange={handleChange}
          required
        />

        <InputField
          type="text"
          placeholder="Telefonnummer"
          name="personalInfo.phone"
          value={cv.personalInfo.phone}
          onChange={handleChange}
          required
        />

        <InputField
          type="text"
          placeholder="Ferdigheter (separert med komma)"
          name="skills"
          value={cv.skills.join(", ")}
          onChange={(e) => setCv({ ...cv, skills: e.target.value.split(", ") })}
        />

        <InputField
          type="text"
          placeholder="Utdanning (separert med komma)"
          name="education"
          value={cv.education.join(", ")}
          onChange={(e) =>
            setCv({ ...cv, education: e.target.value.split(", ") })
          }
        />

        <InputField
          type="text"
          placeholder="Erfaring (separert med komma)"
          name="experience"
          value={cv.experience.join(", ")}
          onChange={(e) =>
            setCv({ ...cv, experience: e.target.value.split(", ") })
          }
        />

        <InputField
          type="text"
          placeholder="Referanser (separert med komma)"
          name="references"
          value={cv.references.join(", ")}
          onChange={(e) =>
            setCv({ ...cv, references: e.target.value.split(", ") })
          }
        />

        <div className="flex justify-center w-full">
          <button
            type="submit"
            className="mt-8 p-3 text-white bg-[#0077B6] rounded-lg hover:bg-[#023E8A] focus:ring-4 focus:ring-[#90E0EF]"
          >
            {isEditing ? "Oppdater CV" : "Opprett CV"}
          </button>
        </div>
      </form>

      {isEditing && (
        <button
          onClick={handleDelete}
          className="mt-4 px-4 py-2 text-white bg-red-500 rounded-lg hover:bg-red-600 focus:outline-none focus:ring-4 focus:ring-[#CAF0F8]"
        >
          Slett CV
        </button>
      )}
    </div>
  );
};

export default UserCV;
